QtScriptShell_Effect::QtScriptShell_Effect(const Phonon::EffectDescription&  description, QObject*  parent)
    : Phonon::Effect(description, parent) {}

QtScriptShell_Effect::~QtScriptShell_Effect() {}

void QtScriptShell_Effect::childEvent(QChildEvent*  arg__1)
{
    QScriptValue _q_function = __qtscript_self.property("childEvent");
    if (!_q_function.isFunction() || QTSCRIPT_IS_GENERATED_FUNCTION(_q_function)
        || (__qtscript_self.propertyFlags("childEvent") & QScriptValue::QObjectMember)) {
        Phonon::Effect::childEvent(arg__1);
    } else {
        QScriptEngine *_q_engine = __qtscript_self.engine();
        _q_function.call(__qtscript_self,
            QScriptValueList()
            << qScriptValueFromValue(_q_engine, arg__1));
    }
}

